import { Button, Div, Main, Settings, memo, useSelector, useStore } from "../../importAll";

const GuestHome = memo(()=>{
    let settings   = useSelector<IStore,Settings>(store=>store.settings)
    let mainPage   = useSelector<IStore,AllMainPagesType>(store=>store.mainPage)
    let subPage    = useSelector<IStore,AllSubPagesType>(store=>store.subPage)
    let isLogin    = useSelector<IStore,boolean>(store=>store.isLogin)

    console.log(333)
    if(mainPage!="Guest" || subPage!="Guest-Home")
        return <></>;
    else if(isLogin)
        return <></>;
        
    return(
        <Main position={settings.GUEST_MAIN_POSITION} Grid={19}>
            <Button toSubPage="Guest-Login"    position="14,5|18,9"   value="התחברות" />
            <Button toSubPage="Guest-Register" position="12,10|16,14" value="הרשמה"   />
            <Div className="Ad" border position="3,3|7,11"> </Div>
        </Main>
    )
}) 

export default GuestHome;
